import React, { Component } from 'react';
import ExpandableGif from '../components/ExpandableGif';

/*
* 
*/
class SearchResult extends Component {

	searchResultToExpandable() {
		return this.props.search_result.map((pic)=>{
			return (<ExpandableGif key={pic.id} height_is_fixed={false} handleSubmit={this.props.handleSubmit} handleShareButton={this.props.handleShareButton} pic={pic} handleActiveGif={this.props.handleActiveGif} handleInfoButton={this.props.handleInfoButton}/>);
		})
	}

	render() {
		if (this.props.search_result.length === 0) {
			return null; 
		}

		return (
		 <div>{this.searchResultToExpandable()}</div>
		);
	}
}

export default SearchResult;
